"ನಿಮ್ಮ ಅನುಮತಿಯೊಂದಿಗೆ, OnePlus ಉತ್ಪನ್ನದ ವಿನ್ಯಾಸ ಮತ್ತು ಬಳಕೆದಾರರ ಅನುಭವವನ್ನು ಸುಧಾರಿಸಲು ನಿಮ್ಮ ಫೋನ್ ಬಳಕೆಯ ಮಾಹಿತಿಯನ್ನು ಸಂಗ್ರಹಿಸುತ್ತದೆ. ನೀವು ಬಳಕೆದಾರ ಅನುಭವ ಪ್ರೋಗ್ರಾಂ (“ಪ್ರೋಗ್ರಾಂ”) ಸೇರಿಸಲು ಸಮ್ಮತಿಸಿದರೆ, OnePlus ಈ ಕೆಳಗಿನ ಮಾಹಿತಿಯನ್ನು ಸಂಗ್ರಹಿಸಬಹುದು, ಬಳಸಬಹುದು ಮತ್ತು ವಿಶ್ಲೇಷಿಸಬಹುದು ಎಂದು ನೀವು ಒಪ್ಪುತ್ತೀರಿ ಎಂದು ಇದು ಸೂಚಿಸುತ್ತದೆ: 
 (1) ಕಾನ್ಫಿಗರೇಶನ್ ಡೇಟಾ;
 (2) ಅಪ್ಲಿಕೇಶನ್ ಪ್ರೋಗ್ರಾಂನ ಅಂಕಿಅಂಶಗಳ ಡೇಟಾ;
 (3) ಬಳಕೆದಾರರ ನಡುವಳಿಕೆ ಡೇಟಾ;
 ಮೇಲಿನ ಡೇಟಾವನ್ನು ಸಂಗ್ರಹಿಸುವ ಮತ್ತು ವಿಶ್ಲೇಷಿಸುವ ಮೂಲಕ, OnePlus ಬಳಕೆದಾರರ ಅನುಭವವನ್ನು ಸುಧಾರಿಸಲು ಗುರಿ ಹೊಂದಿದ್ದು, ಬ್ಯಾಟರಿ ದಕ್ಷತೆ ಮತ್ತು ಸಿಸ್ಟಂ ಸ್ಥಿರತೆಯನ್ನು ಸುಧಾರಿಸುವ ಮೂಲಕ ಎಲ್ಲಾ ಕಾರ್ಯವಿಧಾನಗಳು OnePlus ಗೆ ಅನಾಮಧೇಯ ಮತ್ತು ಎನ್‌ಕ್ರಿಪ್ಟ್ ರೂಪದಲ್ಲಿವೆ, ಯಾವುದೇ ವೈಯಕ್ತಿಕ ಗುರುತನ್ನು ಗುರುತಿಸುವುದಕ್ಕಾಗಿ ಈ ಡೇಟಾವನ್ನು ಬಳಸಲಾಗುವುದಿಲ್ಲ. ನೀವು ಪ್ರೋಗ್ರಾಂ ಸೇರಿದ ನಂತರ, ಕೆಳಗಿನ ವಿಧಾನದ ಮೂಲಕ ಯಾವುದೇ ಸಮಯದಲ್ಲಿ ನೀವು ಹಿಂಪಡೆಯಬಹುದು: ಸೆಟ್ಟಿಂಗ್‌ - ಸುಧಾರಿತ - ಬಳಕೆದಾರರ ಅನುಭವ ಪ್ರೋಗ್ರಾಂ ಮತ್ತು ಬಾಕ್ಸ್ ಅನ್ನು ಆಯ್ಕೆಮಾಡದಿರುವುದು. OnePlus ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಿದ ಮಾಹಿತಿಯ ಕುರಿತು ಇನ್ನಷ್ಟು ತಿಳಿದುಕೊಳ್ಳಲು ದಯವಿಟ್ಟು OnePlus ಗೌಪ್ಯತೆ ನೀತಿಯನ್ನು ನೋಡಿ. ಒಮ್ಮೆ ಪ್ರೋಗ್ರಾಂನಿಂದ ನೀವು ಹಿಂಪಡೆದರೆ, OnePlus ಮೇಲಿನ ನಿಮ್ಮ ಮಾಹಿತಿ ವಿಧಾನದಿಂದ ಸಂಗ್ರಹಿಸುವುದನ್ನು ನಿಲ್ಲಿಸುತ್ತದೆ."
